import React from 'react';
import './marker.css';
class CustomMarker extends React.Component {

    constructor(props) {
        super(props)
    }
    render() {
        console.log(this.props);
        return (
            <div className="marker"
            style={{ backgroundColor: 'rgb(255, 230, 230)', cursor: 'pointer'}}
        />)
    }
}

export default CustomMarker;
